import logo from "../images/logo.png"

export default function Login() {
    const contentStyle = {
        position: "fixed",
        top: "50%",
        left: "50%",

        transform: "translate(-50%, -50%)"
    }
    return (
        <div style={contentStyle}>
            <img style={{ margin: `8rem`}}src={logo} alt="logo" />
            <h1>Login Page</h1>
        </div>

    )

}
